import { useState } from "react";

function Home() {
    const [cnt, setCnt] = useState(0);
    return (
        <div>
            Home
            <button onClick={()=>{
                setTimeout((b)=> {
                    console.log(b + "sss");
                    setCnt((a)=>{
                        console.log(a);
                        return a+1;
                    });
                }, Math.random()*2000);
            }}
            >{cnt}</button>
        </div>
    )
}

export default Home;
